INSERT INTO notice (id, title, contents, author, is_open, created_at, updated_at) VALUES
(1, '신제품 출시 안내 - Nike Air Max 2024', '12월 1일 Nike Air Max 2024 모델이 출시됩니다. 사전 예약 접수 시작하며, 조기 품절이 예상되니 재고 확보 부탁드립니다.', '본부장', False, NOW(), NOW()),
(2, '설 명절 배송 일정 안내', '설 연휴 기간 물류센터 휴무로 1월 20일-25일 배송이 중단됩니다. 미리 발주 부탁드립니다.', '이지은', True, NOW(), NOW()),
(3, '설 명절 배송 일정 안내', '설 연휴 기간 물류센터 휴무로 1월 20일-25일 배송이 중단됩니다. 미리 발주 부탁드립니다.', '본사 운영팀', True, NOW(), NOW()),
(4, 'POS 시스템 업데이트 안내', '12월 5일 자정부터 새벽 5시까지 POS 시스템 정기 업데이트가 진행됩니다. 해당 시간 결제 불가하오니 참고 바랍니다.', '본부장', True, NOW(), NOW()),
(5, '안전 교육 이수 안내', '전 직원 대상 안전 교육 이수가 필수입니다. 12월 말까지 완료 부탁드립니다.', '이지은', True, NOW(), NOW()),
